                <span>
                  Save photos and videos that you want to see again. No one is
                  notified, and only you can see what you've saved.
                </span>
              </div>
            </div>
          </>
        ) : (
          <> </>
        )}
      </div>
    </>
  );
};

export default SavedPost;
